import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import React from 'react';
import Header from "./Components/Header";
// import GetPlayers from "./Components/GetPlayers";
// import AddPlayers from "./Components/AddPlayers";
// import DeletePlayers from "./Components/DeletePlayers";
// import UpdatePlayers from "./Components/UpdatePlayers";
// import Page404 from './Components/Page404';
// import Home from "./Components/Home";
import View from "./Components/View";
import Add from "./Components/Add";
import Login from "./Components/Login";
import DemoGetData from './Components/DemoGetData';

const Routes = () => {

    return (
        <div>
            <Router>
                <div>
                    <Header />
                    <div>
                    <Switch>
                            <Route exact path="/" > <Login /> </Route>
                            <Route exact path="/get" > <View /> </Route>
                            <Route path="/post" > <Add /></Route>
                            <Route path="/demodata" > <DemoGetData /></Route>
                            </Switch>
                    </div>

                </div>
            </Router>
        </div>
    );

}
export default Routes;
